    const handleSubmit=(e)=>{
       e.preventDefault();
        console.log(email)
    }
return (
    
    <div className="Login-Container">
        <h2>Login</h2>
    <form className="Login-form" onSubmit={handleSubmit}>
        <label htmlFor="email">Email</label>
        <input value={email} onChange={(e)=>setName(e.target.value)}type="email" placeholder="abc@gmail.com" id="email" name="email"></input>
        <label htmlFor="password">Password</label>
        <input value={pass}  type="password" placeholder="Pass@123" id="password" name="password"></input>
        <button type="Submit">Login</button>
    </form>
         <button className="link-btn" onClick={()=> props.onFormSwitch('Register')}>If you don't have acccout? Register Here.</button>
    
         </div>
    
)

}
export default Login;


